CREATE PROCEDURE dbo.proc_transform_106
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_106
    SET payload = LEFT(payload, 1000) + N'|V4-106|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_106;
END
